package com.lndp.model;

public class Advertisement {

	private String height;
	
	private String width;
	
	private String flashvars;
	
	private String wmode;
	
	private String allowscriptaccess;
	
	private String quality;
	
	private String name;
	
	private String id;
	
	private String style;
	
	private String src;
	
	private String type;
	
	public Advertisement() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getHeight() {
		return height;
	}

	public void setHeight(String height) {
		this.height = height;
	}

	public String getWidth() {
		return width;
	}

	public void setWidth(String width) {
		this.width = width;
	}

	public String getFlashvars() {
		return flashvars;
	}

	public void setFlashvars(String flashvars) {
		this.flashvars = flashvars;
	}

	public String getWmode() {
		return wmode;
	}

	public void setWmode(String wmode) {
		this.wmode = wmode;
	}

	public String getAllowscriptaccess() {
		return allowscriptaccess;
	}

	public void setAllowscriptaccess(String allowscriptaccess) {
		this.allowscriptaccess = allowscriptaccess;
	}

	public String getQuality() {
		return quality;
	}

	public void setQuality(String quality) {
		this.quality = quality;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getStyle() {
		return style;
	}

	public void setStyle(String style) {
		this.style = style;
	}

	public String getSrc() {
		return src;
	}

	public void setSrc(String src) {
		this.src = src;
	}

	public String getType() {
		return type;
	}

	public void setType(String type) {
		this.type = type;
	}
	
	
}
